  [],\n\t\"revision_timestamp\": \"2015-05-07T14:29:07.289029\",\n\t\"name\": \"computational-modeling-in-support-of-high-altitude-testing-facilities-project-ed6ce\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Simulation technology plays an important
  role in rocket engine test facility design and development by assessing risks, identifying
  failure modes and predicting anomalous behavior of critical systems.  Advanced numerical
  tools assume greater significance in supporting testing and design of high altitude
  testing facilities because of the greater inter-dependence and synergy in the functioning
  of the different sub-systems.  This is especially true for J2-X testing because
  of a challenging operating envelope linked to variable throttle conditions at relatively
  low chamber pressures.  Facility designs require a complex network of diffuser ducts,
  steam ejector trains, fast operating valves, spray nozzles and flow diverters that
  need to be characterized for steady state performance.  More importantly, integrated
  facility designs will also have to be evaluated for startup/shutdown transients
  that can trigger engine unstart modes leading to catastrophic failure.  The proposed
  innovation expands on the multi-element unstructured CFD which has been validated
  for complex valve/feed systems and high pressure propellant delivery systems used
  in engine and component test stands at NASA SSC.  The focus here will be on extending
  this capability to include advanced models for supersonic diffuser design, steam
  ejector performance, spray nozzle cooling efficiency, plume aspiration dynamics
  and isolation valve operation.  \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
